"""###Separating Exoplanets from Non-Exoplanets

In this dataset, a label of 1 indicates a star that has an exoplanet, and a label of 0 indicates some false positive source that is not an exoplanet.

**The [`dataframe.loc`](https://pandas.pydata.org/docs/reference/api/pandas.DataFrame.loc.html) property to separate the exoplanets from the non-exoplanets.** In the `non_exo_data` example below, we use `labels==0`, which will produce an array of `True` and `False` values based on whether each label is 0.
"""

